DROP TABLE IF EXISTS `m_v_nft_liked`;
CREATE ALGORITHM=UNDEFINED DEFINER=`u434053783_artksy`@`127.0.0.1` SQL SECURITY DEFINER VIEW `m_v_nft_liked` AS select `m_nft_supply`.`id` AS `id`,`m_nft_supply`.`tokenid` AS `tokenid`,`m_nft_supply`.`txhash` AS `txhash`,`m_nft_supply`.`tokenuri` AS `tokenuri`,`m_nft_supply`.`id_nftcustomer` AS `id_nftcustomer`,`m_nft_supply`.`image` AS `image`,`m_nft_supply`.`ipfs` AS `ipfs`,`m_nft_supply`.`name` AS `name`,`m_nft_supply`.`description` AS `description`,`m_nft_supply`.`id_nftcategory` AS `id_nftcategory`,`m_nft_supply`.`price` AS `price`,`m_nft_supply`.`amount` AS `amount`,`m_nft_supply`.`tipe` AS `tipe`,`m_nft_supply`.`collection` AS `collection`,`m_nft_supply`.`homes` AS `homes`,`m_nft_supply`.`minimum_bid` AS `minimum_bid`,`m_nft_supply`.`start_date` AS `start_date`,`m_nft_supply`.`end_date` AS `end_date`,`m_nft_supply`.`network` AS `network`,`m_nft_supply`.`network_tipe` AS `network_tipe`,`m_nft_supply`.`network_url` AS `network_url`,`m_nft_supply`.`contract_address` AS `contract_address`,`m_nft_supply`.`created_by` AS `created_by`,`m_nft_supply`.`created_on` AS `created_on`,`m_nft_supply`.`updated_by` AS `updated_by`,`m_nft_supply`.`updated_on` AS `updated_on`,(select `m_nft_brand`.`name` from `m_nft_brand` where `m_nft_brand`.`id` = `m_nft_supply`.`id_brand` limit 1) AS `brand`,(select `m_nft_category`.`name` from `m_nft_category` where `m_nft_category`.`id` = `m_nft_supply`.`id_nftcategory` limit 1) AS `cats`,dayofmonth(`m_nft_supply`.`end_date`) AS `day_limit`,month(`m_nft_supply`.`end_date`) AS `bulan_limit`,year(`m_nft_supply`.`end_date`) AS `tahun_limit`,(select count(`m_nft_heart`.`id`) from `m_nft_heart` where `m_nft_heart`.`id_nft_supply` = `m_nft_supply`.`id` limit 1) AS `total_liked` from `m_nft_supply`;

